import React from 'react';

function FilterJobSearch() {
  return (
    <div className="left-section">
      <ul class="list-unstyled">
    <li><a class="text-decoration-none text-white" href="#"><i class="bi bi-house-door"></i> My Jobs</a></li>
    <li><a class="text-decoration-none text-white" href="#"><i class="bi bi-gear"></i> Preferences</a></li>
    <li><a class="text-decoration-none text-white" href="#"><i class="bi bi-bar-chart"></i> Demonstrate Skills</a></li>
    <li><a class="text-decoration-none text-white" href="#"><i class="bi bi-journal-bookmark"></i> Interview Prep</a></li>
    <li><a class="text-decoration-none text-white" href="#"><i class="bi bi-file-earmark-text"></i> Resume Builder</a></li>
    <li><a class="text-decoration-none text-white" href="#"><i class="bi bi-person"></i> Job Seeker Guidance</a></li>
    <li><a class="text-decoration-none text-white" href="#"><i class="bi bi-gear"></i> Application Settings</a></li>
    <li><a class="text-decoration-none text-white" href="#"><i class="bi bi-upload"></i> Post a Job</a></li>
  </ul>
    </div>
  );
}

export default FilterJobSearch;
